sourcesContent:
// index.js

import express from 'express';
import { tempRouter } from './routes/temp.route';

const app = express();
const port = 3000;

// router setting
app.use('/temp', tempRouter);

app.listen(port, () => {
    console.log(`Example app listening on port ${port}`)
});
